import './popup.scss';
import { Link } from 'react-router-dom';


const Popup = (props) => {
  return (props.trigger) ? (
    <div className="pop-up">
      <div className="pop-up_inner">
        <h1>Вітаємо <br/>у магазині здорового харчування<br /><span>Humane and Healthy</span></h1>
        <div>
          <Link to="/store">перейти до вибору товарів</Link>
        </div>
      </div>
    </div>
  ) : ""
} 

export default Popup;
